function isString(t){return"string"==typeof t||"object"==typeof t&&t.constructor===String}function getContent(t){return isString(t)?(t=t.toUpperCase(),"ABOUT"===t?content_db.ABOUT.content:"HACKER"===t?content_db.HACKER.content:"HIPSTER"===t?content_db.HIPSTER.content:"HUSTLER"===t?content_db.HUSTLER.content:"ERROR-NO-KEY"+t):"INPUT-NOT-STRING"}function auxClick(t){$("#header").fadeOut(function(){$(this).text(t).fadeIn()}),$("#content-text").fadeOut(function(){$(this).text(getContent(t)).fadeIn()})}var content_db={ABOUT:{content:"Dion Low grew up in Valparaiso, Indiana where in 2012, he graduated Valparaiso High School (VHS) with an IB Diploma at the top of his class. Currently he is finishing his undergraduate degree in Computer Science (6-3) at Massachusetts Institute of Technology (MIT). He is an All-American Swimmer, has trained at the Olympic Training Center (Colorado),  and his career best US national rank is 7th."},HACKER:{content:"I am working on an iOS app in the transportation industry with a non-technical partner. My last internship was in cyber security.",skills:"Python, Java, UNIX, SQL, Node.js, Splunk, C#, Emacs, GitHub"},HIPSTER:{content:"I am prototyping websites for personal use, the Korean Student Association, and Phi Beta Epsilon (pbe.mit.edu). My camera of choice is the DSLR 7100 35mm."},HUSTLER:{content:"I am leading two clubs: MIT Poker Club (Co-Founder, President) and MIT Korean Student Association (President). I enjoy reading books about productivity hacking, entreprenuership, and management."}};$("#go-hacker").click(function(){var t="HACKER";auxClick(t)}),$("#go-hipster").click(function(){var t="HIPSTER";auxClick(t)}),$("#go-hustler").click(function(){var t="HUSTLER";auxClick(t)}),$("#go-about").click(function(){var t="ABOUT";auxClick(t)});